import React from 'react';

const ItemCart = ({item}) => {
    return (
        <div>
            <th scope="col">Producto:</th>
            <td>{item.name}</td> 
            <th scope="col">Cantidad pedida:</th>
            <td>{item.amount}</td> 
            <th scope="col">Precio:</th>
            <td>${item.price}</td>
        </div>
    );
}

export default ItemCart;
